import React, { useState } from 'react';
import {
    Dialog,
    DialogContent,
    DialogTitle,
    Typography,
    Chip,
} from '@mui/material';
export default function ApptDialog({ selectedStartTimes,doctorName, docId,doctorUniqId, id, dialogOpen, handleCloseDialog, selectedDate, doctorsAvailability, setSelectedStartTime, handleBooking }) {
